import React, { useEffect, useState } from 'react';
import Tmdb from './Tmdb';


export default () => {

  const [movieList, setMovieList] = useState([]);

  useEffect(()=>{
    const loadAll = async () => {
      // pegar toda a lista
      let list = await Tmdb.getHomeList();
      setMovieList(list);
    }

    loadAll();
  }, []);

  return (
    <div className="page"> 
      Header
      Destaque
      As listas
      Rodapé basicão
    </div>
  )
}
